actionConfiguration.body:
() => {
  let data = S_LEADS.SCHD();
  let count = 0;
  for (let i = data.length - 1; i >= 0; i--) {
    if (data[i].REMARK == "RNR" || data[i].REMARK == "CALL BACK" && data[i].ACTIVE == true) {
      count = count + 1;
    }
  }
  return count;
}

